import React from 'react'
// import '../css/navbar.css'
 //import {Link} from 'react-router-dom';
import "./navbar.css";
import SearchIcon from '@mui/icons-material/Search';


function Navbar() {
  
    return (
      <div>
     <div className='overall_nav'>
       <img src='yumy.png' className='my_logo' alt='logo'></img>

      

        <div className='nav_link3'>
        <a href='#'>Home</a>
        </div>

        <div className='nav_link3'>
        <a href='#'>Menu</a>
        </div>




        <div className='nav_link1'>
        <a href='#'>About</a>
        </div>

        <div className='nav_link2'>
        <a href='#'>Contact</a>
        </div>

       <button id='btns'>Sign In</button>
       <button id='btn-r'>Register</button>
       
      </div>
      </div>
     
      
            
    );
    
}

export default Navbar;
